import React, { useRef, useState } from 'react';
import { Canvas } from '@react-three/fiber';
import { PerspectiveCamera } from '@react-three/drei';
import { Button } from "./ui/button";
import { AlertTriangle, Shield, LogIn } from 'lucide-react';
import LoginModal from './modals/LoginModal';
import SignupModal from './modals/SignupModal';
import { RainbowButton } from "./ui/rainbow-button";
import WordRotate from "./ui/word-rotate";
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const Scene = () => {
  return (
    <>
      <PerspectiveCamera makeDefault position={[0, 2, 5]} />
      <ambientLight intensity={0.5} />
      <directionalLight position={[5, 5, 5]} intensity={1} />
    </>
  );
};

const AnimatedLoginButton = ({ onClick }) => {
  const [isHovered, setIsHovered] = useState(false);

  return (
    <motion.div
      whileHover={{ scale: 1.05 }}
      whileTap={{ scale: 0.95 }}
    >
      <Button
        variant="ghost"
        className="relative overflow-hidden group px-6 py-2 rounded-full bg-gradient-to-r from-blue-500/10 to-cyan-500/10 hover:from-blue-500/20 hover:to-cyan-500/20 text-gray-800"
        onClick={onClick}
        onMouseEnter={() => setIsHovered(true)}
        onMouseLeave={() => setIsHovered(false)}
      >
        <motion.div
          className="flex items-center gap-2"
          animate={{
            x: isHovered ? 5 : 0,
          }}
          transition={{ type: "spring", stiffness: 300, damping: 20 }}
        >
          <span>Log in</span>
          <motion.div
            animate={{
              rotate: isHovered ? 90 : 0,
              x: isHovered ? 5 : 0,
            }}
            transition={{ type: "spring", stiffness: 300, damping: 20 }}
          >
            <LogIn className="w-4 h-4" />
          </motion.div>
        </motion.div>
      </Button>
    </motion.div>
  );
};

export default function LandingPage() {
  const [isLoginOpen, setLoginOpen] = useState(false);
  const [isSignupOpen, setSignupOpen] = useState(false);

  return (
    <div className="bg-gray-200 relative overflow-hidden font-sans min-h-screen">
      <div className="absolute inset-0">
        <Canvas>
          <Scene />
        </Canvas>
      </div>

      <div className="relative z-10 flex flex-col min-h-screen">
        <nav className="p-4 sm:p-6">
          <div className="max-w-7xl mx-auto flex items-center justify-between">
            <Link to="/" className="flex items-center space-x-2 hover:opacity-80 transition-opacity">
              <Shield className="w-6 h-6 sm:w-8 sm:h-8 text-blue-500" />
            </Link>
            <AnimatedLoginButton onClick={() => setLoginOpen(true)} />
          </div>
        </nav>

        <main className="flex-grow flex items-center justify-center p-4 sm:p-6">
          <div className="max-w-4xl mx-auto text-center">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6 }}
            >
              <h1 className="text-4xl sm:text-5xl md:text-7xl font-extrabold text-gray-800 mb-4 sm:mb-6 tracking-tight leading-tight">
                <div className="flex flex-col sm:flex-row items-center justify-center gap-2">
                  <span>Secure Telegram</span>
                  <WordRotate
                    className="bg-gradient-to-r from-blue-500 to-cyan-500 text-transparent bg-clip-text"
                    words={["Users", "Chats", "Groups"]}
                  />
                </div>
                <span className="text-gray-800">
                  With Tele-Intelli
                </span>
              </h1>
              <p className="text-lg sm:text-xl md:text-2xl text-gray-600 mb-6 sm:mb-8 max-w-2xl mx-auto font-light leading-relaxed px-4">
                Enhance your group chats with advanced security features.
                <br className="hidden md:block" />
                Stay protected against spam, scams, and unwanted content.
              </p>
              <div className="flex flex-col sm:flex-row items-center justify-center gap-4">
                <RainbowButton
                  size="lg"
                  className="text-white min-w-[200px] text-lg"
                  onClick={() => setSignupOpen(true)}
                >
                  Get Started
                </RainbowButton>
              </div>
            </motion.div>
          </div>
        </main>

        <motion.div
          className="absolute bottom-10 sm:bottom-20 right-8 sm:right-32"
          animate={{
            y: [0, -20, 0],
            rotate: [0, 5, 0],
          }}
          transition={{
            duration: 4,
            repeat: Infinity,
            ease: "easeInOut",
          }}
        >
          <AlertTriangle className="w-12 h-12 sm:w-16 sm:h-16 text-blue-500/40" />
        </motion.div>
      </div>

      <LoginModal isOpen={isLoginOpen} onClose={() => setLoginOpen(false)} />
      <SignupModal isOpen={isSignupOpen} onClose={() => setSignupOpen(false)} />
    </div>
  );
}
